        onRefresh (url = this.href, isReferrer = false, isReloadActivity = false) {
            if(isReloadActivity) {
                if(w) {
                    w.finishActivity();
                    w.openEmbed(url, false);
                }
                else window.location.href = url;
            }
            else {
                if(w && !isReferrer) {
                    w.hide();
                    setTimeout(() => w.loadLink(url), 1000);
                }
                else window.location.href = url;
            }
        }
        onTestVideo (url = "", isReturn = false, onRetun = () => {}) {
            if(url !== "") {
                const videoElem = document.createElement("video");

                videoElem.setAttribute("src", url);
                videoElem.addEventListener("canplay", () => {
                    if(isReturn) onRetun(true);
                    else this.onVideo(url);
                    $(videoElem).remove();
                });
                videoElem.addEventListener("error", () => {
                    if(isReturn) onRetun(false);
                    else this.onError();
                    $(videoElem).remove();
                });
            } 
            else this.onError();
        }
        onVideoFlags () {
            const onUpdate = (videoProgress = 0) => {
                const lastViewedItem = callback.userDB.getItem(storeKey, itemId);
        
                if(this.onIsObject(lastViewedItem) && !this.onIsObjectEmpty(lastViewedItem)) run(lastViewedItem, videoProgress);
            };
            const run = (lastViewedItem, videoProgress) => {
                lastViewedItem.itemProgress = this.onIsObject(lastViewedItem.itemProgress) ? lastViewedItem.itemProgress : {};
                const titleActive = lastViewedItem?.lastViewed ?? "movie";
                lastViewedItem.itemProgress[titleActive] = (videoProgress <= 0) ? 1 : videoProgress;
                
                if(titleActive === "movie" && videoProgress === 100) lastViewedItem.ended = true;
                callback.userDB.changeItem(v.replaceSt, storeKey, lastViewedItem);
            };
            const videoElem = this.videoElem;
            const playlist = callback.userDB.getItem(v.storePlaylist);
            const itemId = this.onParseJSON(playlist?.info ?? "e30=")?.itemId ?? "";
            const itemStoreType = this.onParseJSON(playlist?.info ?? "e30=")?.itemType ?? "";
            const isValidId = !(itemId === "" || itemId === "tv");
            const episodeNextEnable = playlist?.enableNext ?? false;
            const isLive = playlist?.isLive ?? false;
            const storeKey = (itemStoreType === "movie" ? v.storeLastViewedMovies : v.storeLastViewedSeries);
            const update = setInterval(() => {
                const castButtonsElem = $(".cast-buttons");
                const videoTime = videoElem[0].currentTime;
                const videoDuration = videoElem[0].duration;
        
                if(this.videoElem.hasClass("stoped")) clearInterval(update);
                else if(videoTime > 0 && videoDuration > 0) {
                    const videoProgress = Math.round(videoTime / videoDuration * 100);
            
                    if(videoProgress > 90 && castButtonsElem.hasClass("hideControls") && episodeNextEnable && !isReturned) {
                        this.onToggleOptions();
                        isReturned = true;
                    }
                    if(!isLive && isValidId) onUpdate(videoProgress);
                }
            }, 1000);
            const play = setInterval(() => {
                if(!videoElem[0].playing) videoElem.trigger("play");
                if(!videoElem[0].paused) clearInterval(play);
            });
            let isReturned = false;

            if(!isLive && isValidId) {
                const up = setInterval(() => {
                    const videoTime = videoElem[0].currentTime;
                    const videoDuration = videoElem[0].duration;
        
                    if(videoTime > 0 && videoDuration > 0) {
                        clearInterval(up);
                        const lastViewedItem = callback.userDB.getItem(storeKey, itemId);
                        const itemProgress = (this.onIsObject(lastViewedItem?.itemProgress) && !this.onIsObjectEmpty(lastViewedItem?.itemProgress)) ? lastViewedItem.itemProgress : {};
                        const titleActive = lastViewedItem?.lastViewed ?? "movie";
                        const videoProgress = itemProgress[titleActive] ?? 0;
                        const videoCurrentTime = (videoProgress !== 0) ? Math.round((videoDuration/100*videoProgress)) : 0;
        
                        videoElem.attr('currentTime', (videoProgress >= 99) ? 0 : videoCurrentTime);
                        videoElem[0].currentTime = (videoProgress >= 99) ? 0 : videoCurrentTime;
                    }
                }, 0);
            }
            videoElem.on('ended', function() {
                const nextEpisodeBtnElem = $(`[data-action="${v.actionNextEpisode}"]`);

                clearInterval(update);
                if(episodeNextEnable && nextEpisodeBtnElem[0]) nextEpisodeBtnElem[0].click();
            });
            if(!this.onValCheck(videoElem.attr("crossorigin")) && videoElem.find("track")[0]) videoElem.attr("crossorigin", "anonymous");
        }
