            const playlist = d.playlist();
            const title = playlist?.title ?? "";
            const season = parseInt(title?.split("T:")[1]?.split("E:")[0] ?? "0")-1;
            const episode = parseInt(title?.split("E:")[1] ?? "0")-1;
