        async onFetch (url, data = {}, isAjax = false) {
            return await new Promise(async(resolve, reject) => {
                try {
                    let retry = 0;
                    const isPost = (this.onIsObject(data) && !this.onIsObjectEmpty(data));
                    const run = () => {
                        if(retry > 1) reject();
                        else {
                            retry++;
                            if(isAjax) {
                                $.ajax({
                                    url: url,
                                    method: isPost ? 'POST' : 'GET',
                                    data: isPost ? data : {},
                                    success: function(msg) {
                                        resolve(JSON.stringify(msg));
                                    },
                                    error: function(msg) {
                                        run();
                                    }
                                });
                            }
                            else {
                                fetch(url, isPost ? {
                                    method: "POST",
                                    body: JSON.stringify(data)
                                } : {
                                    method: "GET"
                                })
                                .then(async response => await response.text())
                                .then(async response => resolve(response))
                                .catch(err => run());
                            }
                        }
                    };
                    run();
                } catch (err) { reject(err); }
            });
        }
        onParseJSON (str) {
            try {
                if(this.onIsBase64(str)) return JSON.parse(decodeURIComponent(atob(str))); 
                return JSON.parse(decodeURIComponent(str));
            } catch (err) {}
            return null;
        }
        onIsBase64 (str) {
            try {
                if (str ==='' || str.trim() ===''){ return false; }
                return btoa(atob(str)) == str;
            } catch (err) {}
            return false;
        }
        onGetDomainName (hostName) {
            const url = new URL(`https://${hostName.replace(/https:\/\//g, "")}`).hostname.match(/^(?:.*?\.)?([a-zA-Z0-9\-_]{3,}\.(?:\w{2,8}|\w{2,4}\.\w{2,4}))$/)[1];
            try {
                if(hostName.includes(".")) {
                    const domainArray = (new URL(`https://${hostName.replace(/https:\/\//g, "")}`)?.hostname ?? hostName)?.split(".") ?? [];

                    if(domainArray.length === 3) return domainArray[1];
                    else if(domainArray.length === 2) return domainArray[0];
                    return url;
                }
            } catch (err) {}
            return url;
        }
        onUrlCompare (url) {
            try {
                if(url.includes("superflixapi") || url.includes("embedder") || url.includes("embedplayer")) return url.includes(this.onGetDomainName(window.location.href));
                else {
                    const u = [
                        url?.replace("https://", "")?.substring(url?.replace("https://", "")?.indexOf("/")) ?? "",
                        this.onLastPath(window.location.href)
                    ];
            
                    if(u[0] !== "" && u[1] !== "") return u[0].includes(u[1]);
                    return url.includes(this.onGetDomainName(window.location.href));
                }
            } catch (err) {}
            return false;
        }
        onLastPath (str) {
            try {
                const segments = new URL(str).pathname.split('/');
                
                return segments.pop() || segments.pop();
                
            } catch (err) {}
            return str;
        }
        onIsObject (value) {
            try {
                return value.constructor.name === "Object";
            }catch(err) {}
            return false;
        }
        onIsObjectEmpty (objectName) {
            try {
                return Object.keys(objectName).length === 0;
            } catch (err) {}
            return true;
        }
        onIsBoolean (variable) {
            try {
                return (typeof variable == "boolean") 
            } catch (err) {}
            return false;
        }
