    class StorageData2 {
        constructor(key, enableRegisterAll = false, limitSize = 1000000000000000, isLocal = false) {
            return (async () => {
                this.isLocal = isLocal;
                this.limitSize = limitSize;
                this.key = key;
                this.enableRegisterAll = enableRegisterAll;
                this.storageData = (await StorageData2.initList(this.key))?.sort((a, b) => a.time - b.time).reverse()?.map(item => ({...item, itemId: encodedUri(item?.itemId) }));
                this.onChange;
                this.broadcast = new AllInclusiveBroadcaster((data) => {
                        this.storageData = data;
                        try { this.onChange(); }catch(err) {}
                    }, "broadcast-" + this.key);

                if((injectApp?.indexCode ?? indexCode) === 2000) console.log(`Storage key: ${this.key} || Callback all: ${enableRegisterAll ? 'yes' : 'no'} || Sotorage limit: ${this.limitSize} || Items: ${(this.storageData.length === 0) ? 'no have' : this.storageData.length}`);
                return this;
            })();
        }
    
        put(data){
            this.storageData = this.storageData?.sort((a, b) => a.time - b.time).reverse()?.filter((item, index) => (item?.itemId !== "") && (index < this.limitSize))?.map(item => ({...item, itemId: encodedUri(item?.itemId) }));
            if(this.enableRegisterAll) {
                this.broadcast.postMessage(data);
            }else {
                try { this.onChange(); }catch(err) {}
            }
        }
        replaceList(data = []) {
            try {
                if(data.length !== 0 && !this.compareTwoList(this.storageData, data)) {
                    this.clear;
                    this.storageData = data;
                    this.storageData.map(data => this.addStorage(data.itemId, JSON.stringify(data)));
                    this.put(this.storageData);
                }
            } catch(err) {}
        }
        replaceItemData(data) {
            try {
                data = this.parseJSON2(data) ?? {};
                const itemId = data?.itemId ?? "";
    
                if(this.storageData.length > 1 && ((this.storageData.length-1) > this.limitSize)) {
                    const itemId = this.storageData[this.storageData.length-1]?.itemId ?? "";
    
                    if(itemId !== "") {
                        this.storageData = this.storageData.filter(item => item?.itemId !== itemId);
                        this.removeStorage(itemId);
                    }
                }
                if(itemId !== "") {
                    data.time = Date.now();
                    this.storageData = this.storageData.filter(item => item?.itemId !== itemId);
                    this.storageData.push(data);
                    this.addStorage(itemId, JSON.stringify(data));
                }
                this.put(this.storageData);
            } catch(err) { console.log(err); }
        }
        toggleItemData(data) {
            try {
                data = this.parseJSON2(data);
                const itemExistPosition = this.storageData.findIndex((item) => item.itemId == data.itemId);
    
                if(itemExistPosition !== -1) {
                    this.removeStorage(this.storageData[itemExistPosition].itemId);
                    this.storageData.splice(itemExistPosition, 1);
                }
                else {
                    if(this.storageData.length >= this.limitSize) {
                        const itemLastPosition = (this.storageData.length-1);
    
                        this.removeStorage(this.storageData[itemLastPosition].itemId);
                        this.storageData.splice(itemLastPosition, 1);
                    }
    
                    this.addStorage(data.itemId, JSON.stringify(data));
                    this.storageData.splice(0, 0, data);
                }
                this.put(this.storageData);
            } catch(err) { console.log(err); }
        }
        addItemData(data) {
            try {
                data = this.parseJSON2(data);
                const itemExistPosition = this.storageData.findIndex((item) => item.itemId == data.itemId);
    
                if(itemExistPosition === -1) {
                    if(this.storageData.length >= this.limitSize) {
                        const itemLastPosition = (this.storageData.length-1);
    
                        this.removeStorage(this.storageData[itemLastPosition].itemId);
                        this.storageData.splice(itemLastPosition, 1);
                    }
    
                    this.addStorage(data.itemId, JSON.stringify(data));
                    this.storageData.splice(0, 0, data);
                    this.put(this.storageData);
                }
            } catch(err) { console.log(err); }
        }
        removeItemData(itemId) {
            try {
                const itemExistPosition = this.storageData.findIndex((item) => item.itemId == itemId);
    
                if(itemExistPosition !== -1) {
                    this.removeStorage(this.storageData[itemExistPosition].itemId);
                    this.storageData.splice(itemExistPosition, 1);
                    this.put(this.storageData);
                }
            } catch(err) { console.log(err); }
        }
        checkItemData(itemId) {
            try {
                return this.storageData.findIndex((item) => item.itemId == itemId) !== -1;
            } catch(err) {}
            return false;
        }
        getItemData(itemId) {
            try {
                return this.storageData.filter((item) => item.itemId == itemId)[0];
            } catch(err) {}
            return null;
        }
        addStorage(itemId, content) {
            try {
                if(!this.isLocal && w) w.putStorage(this.key, itemId, content);
                else Object.keys(localStorage)
                .filter((sKey) => sKey.includes(this.key+itemId))
                .map((key) => localStorage.removeItem(key));
                localStorage.setItem(Date.now()+"_"+this.key+itemId, content);
            } catch (err) {}
        }
        removeStorage(itemId) {
            try {
                if(!this.isLocal && w) w.removeStorage(this.key, itemId);
                else Object.keys(localStorage)
                .filter((sKey) => sKey.includes(this.key+itemId))
                .map((key) => localStorage.removeItem(key));
            } catch (err) {}
        }
        compareTwoList(listA, listB) {
            try {
                listA.sort(this.compare);
                listB.sort(this.compare);
                return JSON.stringify(listA) === JSON.stringify(listB);
            }catch(err) {}
            return false;
        }
        compare(a, b) {
            if ( a.itemId < b.itemId ){
              return -1;
            }
            if ( a.itemId > b.itemId ){
              return 1;
            }
            return 0;
        }
        parseJSON2(data) {
            try {
                return JSON.parse(decodeURIComponent(atob(data)));
            } catch(err) {}
            return data;
        }
        
    
        get getList() {
            try {
                if(this.storageData.length > 1 && ((this.storageData.length-1) > this.limitSize)) {
                    this.storageData.filter((item, index) => {
                        const itemId = item?.itemId ?? "";
                        
                        if(index > this.limitSize && itemId !=="") this.removeStorage(itemId);
                    });
                }
                return this.storageData?.sort((a, b) => a.time - b.time).reverse()?.filter((item, index) => (item?.itemId !== "") && (index < this.limitSize))?.map(item => ({...item, itemId: encodedUri(item?.itemId) }));
            } catch(err) { console.log(err); }
            return [];
        }
        get clear() {
            try{
                if(!this.isLocal && w) w.clearStorage(this.key);
                else Object.keys(localStorage)
                .filter((sKey) => sKey.includes(this.key))
                .map((key) => localStorage.removeItem(key));
            }
            catch(err) {}
            this.put([]);
        }
    
        static decodeHTMLEntities(text) {
            try {
                var entities = [
                    ['amp', '&'],
                    ['apos', '\''],
                    ['#x27', '\''],
                    ['#x2F', '/'],
                    ['#39', '\''],
                    ['#47', '/'],
                    ['lt', '<'],
                    ['gt', '>'],
                    ['nbsp', ' '],
                    ['quot', '"']
                ];
    
                for (var i = 0, max = entities.length; i < max; ++i)
                    text = text.replace(new RegExp('&' + entities[i][0] + ';', 'g'), entities[i][1]);
    
                return text;
            } catch(err) {}
            return text;
        }
        static encodeHTMLEntities(text) {
            try {
                return text.replace(/[&<>'"]/g,
                tag => ({
                    '&': '&amp;',
                    '<': '&lt;',
                    '>': '&gt;',
                    "'": '&#39;',
                    '"': '&quot;'
                  }[tag]));
            } catch (err) {}
            return text;
        }
        static getDataStore(key) {
            try {
                const items = [];
                Object.keys(localStorage)
                .sort((a , b) => parseFloat(a?.split("_")[0]) - parseFloat(b?.split("_")[0]))
                .filter((sKey) => sKey.includes(key))
                .map((key) => items.push(JSON.parse(localStorage.getItem(key))));
                items.reverse();
    
                return StorageData2.encodeHTMLEntities(JSON.stringify(items));
            }catch(err) {}
            return '[]';
        }
        static async initList(key) {
            return await new Promise((resolve, reject) => {
                const intervalResponse = setTimeout(() => window[key].resolve = ('null', false), 10000);
                window[key] = {
                    resolve: (dataOrErr, isCached) => {
                        if(dataOrErr === 'null' || dataOrErr === '[]') resolve([]);
                        else resolve(JSON.parse(StorageData2.decodeHTMLEntities(dataOrErr))?.sort((a, b) => a.time - b.time).reverse()?.map(item => ({...item, itemId: encodedUri(item?.itemId) })));
                        clearTimeout(intervalResponse);
                        delete window[key];
                    }
                };
    
                if(!this.isLocal && w) w.runAsyncStore(key);
                else window[key].resolve(StorageData2.getDataStore(key), true);
           });
        }
    }
    class AllInclusiveBroadcaster {
        constructor(listener, channelName) {
            if (!channelName) channelName = "channel";
            this.broadcaster = new BroadcastChannel(channelName);
            this.messageReceiver = new BroadcastChannel(channelName);
    
            this.messageReceiver.onmessage = (event) => {
                listener(event.data);
            }
        }
        postMessage(data) {
            this.broadcaster.postMessage(data);
        }
    }
