        getItem: (key, value = "", expire = false, time = "") => {
            if(valCheck(value)) {
                if(expire) setWithExpiry(key, value, time);
                else callback.userDB.changeItem(v.addKeySt, v.storeAppSettings, {
                    list: [
                        {
                            key: key,
                            value: value
                        }
                    ]
                });
                return value;
            }
            else {
                if(expire) return getWithExpiry(key);
                return callback.userDB.getItem(v.storeAppSettings)[key] ?? "";
            }
        },
        imgPreloadList: [],
        imgPreload: async (isSave = true, list = callback.imgPreloadList) => {
            const key = v.keyImgPreload + list[0].encode();
            const isImgPreloadDone = valCheck(getWithExpiry(key));

            if(isImgPreloadDone) return "done";
            else {
                if(isSave) setWithExpiry(key, "done", "1d");
                return await Promise.all(list.map(async (url) => {
                    const img = async () => await new Promise(resolve => {
                        const onResolve = () => {
                            $(img).remove();
                            resolve(url);
                        };
                        const img = new Image();
                        img.src = url;
                        img.onload = () => onResolve();
                        img.onerror = () => onResolve();
                    });
    
                    return await img();
                }));
            }
        }
