            checkAvalabieDomains: async (isDialog = false) => {
                if(v.tagPage === v.homePage) callback.userDB.changeItem(v.removeKeySt, v.storeAppSettings, { list: [ v.keyFont ] });
                v.defaultId = removeTerms(callback.userDB.getItem(v.storeAppSettings)[v.keyFont] ?? "vizer", 0, true);
        
                return await new Promise(async(resolve, reject) => {
                    const run = (percentageSuccess) => {
                        const list = JSON.parse(JSON.stringify(d.fontButtonList));
                        const fontArray = (isArray(d.fontArray) && d.fontArray?.length > 0) ? d.fontArray : callback.fontArray;
        
                        if(percentageSuccess <= 70) {
                            callback.isDomainsCheckError = true;
                            if(isDialog) callback.runDomainError();
                        }
                        v.defaultId = removeTerms((v.defaultId !== "null") ? v.defaultId : (d.fontArray.filter((item, index) => (item?.done ?? false))[0]?.font ?? "vizer"), 0, true);
                        list.map((item, index) => {
                            const isError = !d.fontArray.some(i => (i?.done ?? false) && item?.attrs.includes(i?.font)) && item?.attrs.includes(`data-action="${v.actionLoadDefaultCat}"`);
        
                            if(item.attrs.includes(`data-cat-id="${v.defaultId}"`)) {
                                item.class = item.class + " active";
                            }
                            if(isError) list.push(item);
                            if(item.class.includes("active")) array_move(list, index, v.tagPage === v.homePage ? 0 : 1);
                        });
        
                        d.fontButtonList = list.filter((x,i) => list.findLastIndex(y => y.text == x.text) == i);
                        d.fontButtonList.filter((item, index) => {
                            if(JSON.stringify(item).includes("active")) {
                                array_move(d.fontButtonList, index, (v.tagPage === v.homePage) ? 0 : 1);
                            }
                            return true;
                        });
    
        
                        callback.userDB.changeItem(v.addKeySt, v.storeAppSettings, {
                            list: [
                                {
                                    key: v.keyFontArray,
                                    value: fontArray
                                },
                                {
                                    key: v.keyFont,
                                    value: v.defaultId
                                }
                            ]
                        });
                        resolve();
                    }
        
                    if(isIngles) run(100);
                    else {
                        if(v.tagPage !== v.homePage && v.defaultId !== "null") run(100);
                        promiseAllList(d.checkDomainList)
                        .then(data => {
                            let percentageSuccess = 0;
                            
                            data.map(item => {
                                if(item.itemList === "done") percentageSuccess += item.percentage;
                            });
                            run(Math.round(percentageSuccess));
                        })
                        .catch(err => logs("aborted"));
                    }
                });
            },
